import './App.css';
import {Link} from "react-router-dom";

export function App(props) {
  return (
      <Link to ={props.page} className={props.name} id={props.id}>{props.content}</Link>
  );
}
export function Left(props) {
    return (
        <section id={props.id} className={props.className}>
            <div className={props.classname}>
                <h4>Blog post #{props.post}</h4>
                <p>
                    My <strong>{props.order} blog post</strong> is all about my <span>blog post</span> {props.text}
                </p>
                <br/>
                <p>
                    published {props.number} days ago by {props.author}
                </p>
            </div>
            <div className ="box">
                <div className="line1"></div>
                <div className="line2"></div>
            </div>
        </section>
        );
}
export function Right(props) {
    return (
        <div className={props.className}>
            <h1>{props.title}</h1>
            <h4>Blog post #{props.number1} <a href="#Blog_post_#{props.first}">go to page</a></h4>
            <h4>Blog post #{props.number2} <a href="#Blog_post_#{props.second}">go to page</a></h4>
            <h4>Blog post #{props.number3} <a href="#Blog_post_#{props.third}">go to page</a></h4>
        </div>
    );
}
